    // log("orig: " + o.t + " " + o.a + " [" + o.s + "] " + o.gtag);
    o.t    = ot;
    o.i    = [];
    o.n    = "";
    o.a    = oa;
    o.gai  = [];
    o.s    = srt;
    o.m    = null;
    o.gtag = size;
    o.gi   = [];
